import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  return (
    <div>
      {props.contactsFromApp.map(({name, ...rest}, index) => (
        <Tile
          name={contactObj.name}
          description={rest}
          key={index}
        />
      ))}
    </div>
  );
};
